import styled from 'styled-components';

export const Container = styled.aside`
  grid-column-start: 1;
  grid-column-end: 2;
  border: 0;
  width: 240px;
  flex-shrink: 0;
  background: #485365;
`;

export const Logo = styled.div`
  display: flex;
  justify-content: center;
  align-items: 'center';
  height: 63px;
  flex-shrink: 0;
  background: #434c5b;

  img {
    cursor: pointer;
    height: 64px;
    padding: 15px;
  }
`;
